def generate_ice_cream_sales_graph(ice_cream_sales):
    """"""
    sales_count = [0] * 10
    for ice_cream_type in ice_cream_sales:
        sales_count[ice_cream_type] += 1
    graph = []
    for count in sales_count:
        if count == 0:
            graph.append('-')
        else:
            graph.append('*' * count)
    return graph
